'''
在 D 天内送达包裹的能力
传送带上的包裹必须在 D 天内从一个港口运送到另一个港口。

传送带上的第 i 个包裹的重量为 weights[i]。每一天，我们都会按给出重量的顺序往传送带上装载包裹。我们装载的重量不会超过船的最大运载重量。

返回能在 D 天内将传送带上的所有包裹送达的船的最低运载能力。


提示：

1 <= D <= weights.length <= 50000
1 <= weights[i] <= 500
'''
from typing import List
'''
思路1，暴力回溯
暴力回溯，首先把0..n-D个包裹全部分给第0个船，剩下的每个船分配一个包裹，计算出最大重量
然后逐步减少第0个船的包裹数，递归处理剩下的包裹数。
时间复杂度：O(D^(n-D))，测试案例跑到n=700时，超时了
空间复杂度：O((n-D)!)

思路2，还是回溯
设总计重量为total，平均每船重量为avg
上面的思路1为最大化开始的船重，然后逐步给前面的船减重，
思路2是将开始的船重设置为<=avg且最接近avg的那个数，然后逐步减少后面的船重
时间、空间复杂度：估算不出来了，测试案例跑到n=10000时，超时了

思路3，二分查找
每船的重量下限up=max(low//D，max(weights))
重量上限low=sum(weights)
可以取mid=(low+up)//2，设mid为每船的重量，安装这个重量划分，如果能运送完毕，则进一步降低上限up，
如果不能运送完毕，说明mid过小，需要加大下限low
直至下限超过上限，最近的一次下限肯定是合法的解
时间复杂度：O(nlogn)
空间复杂度：O(1)
'''


class Solution:
    # 思路3，二分查找
    def shipWithinDays(self, weights: List[int], D: int) -> int:
        up = sum(weights)
        low = max(up // D, max(weights))

        def canFinish(mid):
            curWeight = 0
            shipNum = 1
            for w in weights:
                if curWeight + w > mid:  # 如果重量超过规定的标准重量，需要加船数量
                    shipNum += 1
                    curWeight = 0
                curWeight += w
            return shipNum <= D  # 如果船的数量不大于D，说明可以运送完毕

        while low <= up:  # 二分查找
            mid = (up + low) >> 1
            if canFinish(mid):
                up = mid - 1
            else:
                low = mid + 1
        return low

    # 思路2，回溯
    def shipWithinDays2(self, weights: List[int], D: int) -> int:
        n = len(weights)
        if n == D:
            return max(weights)
        prefixSum = [0] * n  # 前缀和
        prefixSum[0] = weights[0]
        for i in range(1, n):
            prefixSum[i] = prefixSum[i - 1] + weights[i]
        avg = prefixSum[n - 1] / D  # 平均值
        dp = [{} for _ in range(D)]  # 记忆化数组

        def backtrack(index, start):
            if start in dp[index]:
                return dp[index][start]
            end = n - (D - index)  # 当前为第i船，最多允许包括下标[start, end]的包裹
            prefix = 0 if start == 0 else prefixSum[start - 1]
            curWeight = prefixSum[end] - prefix  # 当前最大船重为2个前缀和之差
            if index == D - 1:
                dp[index][start] = curWeight
                return curWeight  # 当前是最后一船，直接返回
            # 找到最接近avg的值
            newstart = start
            if prefixSum[newstart] - prefix <= avg:
                while newstart <= end and prefixSum[newstart] - prefix <= avg:
                    newstart += 1
                newstart -= 1
            curWeight = prefixSum[newstart] - prefix
            nextWeight = backtrack(index + 1, newstart + 1)
            maxWeight = 0
            if curWeight < nextWeight and newstart < end:  # 如果当前船重小于后面船重，需要尝试将当前船增重
                maxWeight = nextWeight
                while curWeight < nextWeight and newstart < end:  # 逐步增重
                    curWeight = prefixSum[newstart + 1] - prefix
                    nextWeight = backtrack(index + 1, newstart + 2)
                    newstart += 1
                    t = max(curWeight, nextWeight)
                    if t > maxWeight:  # 如果新的分配造成最大重量上升，不再执行
                        break
                    else:
                        maxWeight = t
            else:
                maxWeight = curWeight
            dp[index][start] = maxWeight
            return maxWeight

        return backtrack(0, 0)

    # 思路1，暴力回溯
    def shipWithinDays1(self, weights: List[int], D: int) -> int:
        n = len(weights)
        if n == D:
            return max(weights)
        prefixSum = [0] * n  # 前缀和
        prefixSum[0] = weights[0]
        for i in range(1, n):
            prefixSum[i] = prefixSum[i - 1] + weights[i]
        dp = [{} for _ in range(D)]  # 记忆化数组

        def backtrack(index, start):
            if start in dp[index]:
                return dp[index][start]
            end = n - (D - index)  # 当前为第i船，最多允许包括下标[start, end]的包裹
            curWeight = prefixSum[end] if start == 0 else prefixSum[end] - prefixSum[start - 1]  # 当前最大船重为2个前缀和之差
            if index == D - 1:
                dp[index][start] = curWeight
                return curWeight  # 当前是最后一船，直接返回
            maxWeight = float('inf')
            for i in range(end + 1, start, -1):  # 后面的船队包含的包裹数量依次增加，计算出后面的船队的最大船重
                nextWeight = backtrack(index + 1, i)
                maxWeight = min(maxWeight, max(nextWeight, curWeight))
                if nextWeight < curWeight:  # 后面的最大船重小于当前船，当前船可以减少一个包裹给后面的船
                    curWeight -= weights[i - 1]
                else:  # 一旦后面的船队的最大船重已经大于当前船，不需要继续减少当前船的船重了
                    break
            dp[index][start] = maxWeight
            return maxWeight

        return backtrack(0, 0)


s = Solution()
